import React from "react";
import { Nav, NavLink, NavMenu }
	from "./NavbarElements";

const Navbar = () => {
return (
	<>
	<Nav>
		<NavMenu>
		<NavLink to="/page1" activeStyle>
			Page1
		</NavLink>
		<NavLink to="/page2" activeStyle>
			page2
		</NavLink>
		<NavLink to="/page3" activeStyle>
			page3
		</NavLink>
		<NavLink to="/page4" activeStyle>
			page4
		</NavLink>
		</NavMenu>
	</Nav>
	</>
);
};

export default Navbar;
